import React from "react";
import techtorchlogo from "../images/techtorchlogo.jpg";

const ContactUs = () => {
  return (
    <div>
      <div>
        <div>
          <h3>CONTACT US</h3>
          <div>+91-7038782722</div>
          <div>contact@techtorchsolutions.com</div>
          <div>Pune, Maharashtra</div>
        </div>
        <div>
          <h3>SERVICESs</h3>
          <div>App Development</div>
          <div>Website Development</div>
          <div>UI/UX Design</div>
          <div>Digital Marketing and Lead Generation</div>
          <div>Training Programs</div>
        </div>
        <div>
          <img src={techtorchlogo} />
        </div>
      </div>
      <div>Copyright Â© 2024 | Powered by Techtorch solutions</div>
    </div>
  );
};

export default ContactUs;
